import math, pygame, random, time
import import_vectors as vect
import matplotlib.pyplot as plt

pygame.init()

width = 800
height = 600
black = (0, 0, 0)
red = (255, 0, 0)
green = (0, 255, 0)
blue = (0, 0, 255)
white = (255, 255, 255)
running = True
r = 2
r_2 = 6
cor = 1
v_max = 50
gap = 10
wall = 50
t = 0
left_solute_particles = []
right_solute_particles = []
left_solvent_particles = []
right_solvent_particles = []
lst_x = []
lst_y = []
special_case = True

scrn = pygame.display.set_mode((width, height))

class SoluteParticle:
    def __init__(self, r, px, py, clr):
        self.radius = r
        self.pos = vect.Vector(px, py)
        self.clr = clr

    def show(self):
        pygame.draw.circle(scrn, self.clr, (self.pos.x, self.pos.y), self.radius)

class SolventParticle:
    def __init__(self, r, px, py, vx, vy, clr):
        self.radius = r
        self.pos = vect.Vector(px, py)
        self.vel = vect.Vector(vx, vy)
        self.clr = clr

    def updatePos(self):
        self.pos = vect.add(self.pos, self.vel)

    def checkEgdes(self):
        if self.pos.x <= self.radius:
            self.vel.x *= -cor
            self.pos.x = self.radius
        elif self.pos.x >= width - self.radius:
            self.vel.x *= -cor
            self.pos.x = width - self.radius
        if self.pos.y <= self.radius:
            self.vel.y *= -cor
            self.pos.y = self.radius
        elif self.pos.y >= height - self.radius:
            self.vel.y *= -cor
            self.pos.y = height - self.radius

    def show(self):
        pygame.draw.circle(scrn, self.clr, (self.pos.x, self.pos.y), self.radius)

for i in range(100):
    vx = random.randint(-v_max, v_max) / 100
    left_solvent_particles.append(SolventParticle(r, random.randrange(1 + r, width / 2 - r), random.randrange(1 + r, height - r), vx, random.choice([-1, 1]) * math.sqrt(v_max ** 2 / 10000 - vx ** 2), blue))

for i in range(10):
    vx = random.randint(-v_max, v_max) / 100
    right_solvent_particles.append(SolventParticle(r, random.randrange(width / 2 + 1 + r, width - r), random.randrange(1 + r, height - r), vx, random.choice([-1, 1]) * math.sqrt(v_max ** 2 / 10000 - vx ** 2), blue))

for i in range(90):
    right_solute_particles.append(SoluteParticle(r_2, random.randrange(width / 2 + 1 + r_2, width - r_2), random.randrange(1 + r_2, height - r_2), red))

while running:
    scrn.fill(black)

    for event in pygame.event.get():
        if event.type == pygame.QUIT:
            running = False

    c = 0 # c ==> count
    left_to_right = []
    right_to_left = []
    for i in left_solvent_particles:
        if i.pos.x >= width / 2 - r and i.pos.x <= width / 2 + r:
            for j in range(int(height / (gap + wall))):
                if i.pos.y >= j * (gap + wall) and i.pos.y <= j * (gap + wall) + wall:
                    i.vel.x *= -1
                    if special_case:
                        n_right_solute_particles = len(right_solute_particles)
                        n_right_solvent_particles = len(right_solvent_particles)
                        n_right_paricles = n_right_solute_particles + n_right_solvent_particles
                        while n_right_paricles > 100:
                            choice = random.randrange(0, n_right_paricles)
                            if choice < n_right_solute_particles:
                                choice_2 = random.randrange(0, n_right_solute_particles)
                                right_solute_particles[choice_2].pos.x = random.randrange(1 + r_2, width / 2 - r_2)
                                left_solute_particles.append(right_solute_particles[choice_2])
                                right_solute_particles.pop(choice_2)
                            else:
                                choice_2 = random.randrange(0, n_right_solvent_particles)
                                right_solvent_particles[choice_2].pos.x = random.randrange(1 + r, width / 2 - r)
                                left_solvent_particles.append(right_solvent_particles[choice_2])
                                right_solvent_particles.pop(choice_2)
                            n_right_solute_particles = len(right_solute_particles)
                            n_right_solvent_particles = len(right_solvent_particles)
                            n_right_paricles = n_right_solute_particles + n_right_solvent_particles
                    break
        i.updatePos()
        i.checkEgdes()
        # i.show()

    for i in range(len(left_solvent_particles)):
        if left_solvent_particles[i].pos.x >= width / 2:
            left_to_right.append(i)
    left_to_right.reverse()

    for i in right_solvent_particles:
        if i.pos.x >= width / 2 - r and i.pos.x <= width / 2 + r:
            for j in range(int(height / (gap + wall))):
                if i.pos.y >= j * (gap + wall) and i.pos.y <= j * (gap + wall) + wall:
                    i.vel.x *= -1
                    break
        i.updatePos()
        i.checkEgdes()
        # i.show()

    for i in range(len(right_solvent_particles)):
        if right_solvent_particles[i].pos.x < width / 2:
            right_to_left.append(i)
    right_to_left.reverse()

    for i in left_to_right:
        right_solvent_particles.append(left_solvent_particles[i])
    for i in left_to_right:
        left_solvent_particles.pop(i)

    for i in right_to_left:
        left_solvent_particles.append(right_solvent_particles[i])
    for i in right_to_left:
        right_solvent_particles.pop(i)

    # for i in left_solute_particles:
    #     i.show()

    # for i in right_solute_particles:
    #     i.show()

    if not(t % 200):
        print(t / 1000)
        lst_x.append(t)
        temp_right = len(right_solute_particles)
        temp_left = len(left_solute_particles)
        lst_y.append(temp_right / (temp_right + len(right_solvent_particles)) - temp_left / (temp_left + len(left_solvent_particles)) + (len(right_solvent_particles) - len(left_solvent_particles)) / (len(right_solvent_particles) + len(left_solvent_particles)))
    if t >= 200000:
        running = False
    else:
        t += 1

    # for i in range(int(height / (gap + wall))):
    #     pygame.draw.line(scrn, white, (width / 2, i * (gap + wall)), (width / 2, i * (gap + wall) + wall))

    # pygame.display.update()

pygame.quit()

